window.bookSummaryJSON = "<p><b>This isn't a happy story.</b></p> <p>Not at all. It's a sad story filled with lust, trauma, and dark magic.</p> <p><b>Terra</b></p> <p>Fernestia has destroyed everything, leaving only ashes and the new Shadows that teem beneath our skin. My lovely assassin claims I'm his Shadow mate and has agreed to help me find my brother and ex-boyfriendâ€”if they're still alive.</p> <p><b>Finn</b></p> <p>After my village is destroyed, I'm trapped in an enemy camp surrounded by other survivors. Blood and magic are twins here, and there's a dark itch coming from deep within me. If I ever want to see Terra again, I must become invincible.</p> <p><b>Edgar</b></p> <p>I wake up in a lavish estate with my memories stolen. All I know is that my parents and sister are gone. A sinister boy haunts me, pushing me to uncover the truth of this strange place.</p> <p>Although separated, our hearts are tied. The Shadows running through our veins call to each other, demanding answers. If we're ever to reunite, we must uncover the truths of Fernestia.</p> <p>Everything leads back to Alkrose Academy.</p>"; 
